return (function (time, value, prevValue, timePrev, prevOrigValue) {
    let date = new Date(time);

    // Adjust to UTC-7
    let utcHours = date.getUTCHours() - 7;
    if (utcHours < 0) {
        utcHours += 24;
        date.setUTCDate(date.getUTCDate() - 1); // go back one day if hours go negative
    }

    let year = date.getUTCFullYear();
    let month = (date.getUTCMonth() + 1).toString().padStart(2, '0'); // Months are 0-based
    let day = date.getUTCDate().toString().padStart(2, '0');

    let h = utcHours.toString().padStart(2, '0');
    let m = date.getUTCMinutes().toString().padStart(2, '0');
    let s = date.getUTCSeconds().toString().padStart(2, '0');

    return `${year}-${month}-${day} ${h}:${m}:${s}`; // Full UTC-7 timestamp
})(time, value, prevValue, timePrev, prevOrigValue);

